import "./Form.css"

export default function Form() {
    return (
        <div className="container_form">
            <form>
                
                <div></div>
                <input type="password" placeholder="Password"></input>
                <input type="text" placeholder="User Phone"></input>
                <button>Click Me</button>


           </form>
        </div>
    )
}
